    getPrice(item, ratio) {
        item.price_origin = item.unit_array.find(it => it.ratio == ratio).price;
        item.price = item.price_origin > item.discount ? item.price_origin - item.discount : 0;
        item.ratio = ratio;
        item.unit = item.unit_array.find(it => it.ratio == ratio).unit;
    }
