class DetailDiscountPercentProductsComponent {
    constructor(router, vhAlgorithm, vhComponent, lang, vhQueryCafe, modal) {
        this.router = router;
        this.vhAlgorithm = vhAlgorithm;
        this.vhComponent = vhComponent;
        this.lang = lang;
        this.vhQueryCafe = vhQueryCafe;
        this.modal = modal;
        this.updateProduct = new _angular_core__WEBPACK_IMPORTED_MODULE_3__.EventEmitter();
        this.data = [];
        this.searchProductList = false;
        this.type = 5;
        this.discount_percent_all = 0;
        this.isVisibleEditUnitPrice = false;
        this.percent = 0;
        this.disabled = true;
        this.isVisibleEditUnitQuantity = false;
        this.quantity = 0;
        this.new_discount = 0;
        this.isVisibleEditUnitPriceAll = false;
        this.disabled_all = true;
    }
    ngOnInit() {
        this.getDataById();
    }
    /** Lấy dữ liệu local */
    getDataById() {
        for (let i = 0; i < this.data.length; i++) {
            let product = this.vhQueryCafe.getlocalDetailProduct(this.data[i].id_subproduct ? this.data[i].id_subproduct : this.data[i].id_product);
            this.data[i].name = product.name;
            // this.data[i].price_unit = product.price
            product['unit_array'] = [];
            if (product.units) {
                this.data[i]['unit_array'] = product['unit_array'].concat(product.units); //thêm mảng unit để chọn unit, chọn giá
                this.data[i]['price_unit'] = this.data[i]['unit_array'].find(item => item.ratio == this.data[i].ratio).price;
                this.data[i]['percent_discount'] = this.data[i].percent_reduce;
            }
            else {
                this.data[i]['percent_discount'] = this.data[i].percent_reduce;
                this.data[i] = Object.assign(Object.assign({}, this.data[i]), { unit_array: product['unit_array'] });
            }
        }
    }
    /**
     * bắt sk thay đổi unit của sp
     */
    getPrice(item, ratio) {
        item.price_unit = item.unit_array.find(it => it.ratio == ratio).price;
        item.price = item.price_unit * item.discount;
        item.ratio = ratio;
        item.unit = item.unit_array.find(it => it.ratio == ratio).unit;
    }
    /**
     * bắt sk nhấn nút lưu km , output về component cha dữ liệu sp trong KM
     */
    savePromotions() {
        let products = [];
        for (let i = 0; i < this.data.length; i++) {
            let new_item = {
                id_product: this.data[i].id_product,
                quantity: this.data[i].quantity,
                ratio: this.data[i].ratio ? this.data[i].ratio : 1,
                percent_reduce: this.data[i].percent_discount,
                ptype: this.data[i].ptype
            };
            if (this.data[i].id_subproduct) {
                new_item = Object.assign(Object.assign({}, new_item), { id_subproduct: this.data[i].id_subproduct });
            }
            if (new_item.ptype == 5) {
                let combos = this.data[i].combos;
                new_item = Object.assign(Object.assign({}, new_item), { combos: combos });
            }
            products.push(new_item);
        }
        this.updateProduct.emit(products);
    }
    /**
     * mở drawer chọn sp vào ctkm
     */
    openSearchProductList() {
        this.searchProductList = true;
    }
    /**
     * xử lý danh sách sp đã chọn khi đóng drawer chọn sp vào ctkm
     */
    closeSearchProductList(data) {
        if (data) {
            for (let i = 0; i < data.length; i++) {
                let new_item = {
                    id_product: data[i]._id,
                    price_unit: data[i].price,
                    ratio: data[i].ratio ? data[i].ratio : 1,
                    unit: data[i].unit,
                    percent_discount: 0,
                    quantity: 1,
                    ptype: data[i].type,
                    name: data[i].name,
                    unit_array: data[i].units
                };
                if (data[i].id_subproduct) {
                    new_item = Object.assign(Object.assign({}, new_item), { id_subproduct: data[i].id_subproduct });
                }
                if (new_item.ptype == 5) {
                    let combos = data[i].combos.map(item => {
                        return {
                            id_product: item.id_product,
                            ptype: item.type,
                            price: item.price,
                            ratio: item.ratio ? item.ratio : 1,
                            unit: item.unit ? item.unit : '',
                            quantity: item.quantity,
                            id_category: data[i].id_category
                        };
                    });
                    new_item = Object.assign(Object.assign({}, new_item), { combos: combos });
                }
                if ((this.data.length + data.length) <= 100) {
                    this.data.unshift(new_item);
                }
                else {
                    this.modal.error({
                        nzTitle: 'Số lượng sản phẩm vượt quá giới hạn',
                        nzContent: 'Vui lòng tạo thêm khuyến mãi khác !'
                    });
                    break;
                }
            }
        }
        this.searchProductList = false;
    }
    /**
     * mở modal nhập giá giảm sp
     */
    openEditUnitPrice(detail) {
        this.tempDetail = detail;
        this.isVisibleEditUnitPrice = true;
        this.vhAlgorithm.waitingStack().then(() => {
            this.percent = this.vhAlgorithm.vhnumeral('.unit_price');
        });
    }
    /**
     * xử lý sk nhấn ok modal nhập giá giảm sp
     */
    handleEditUnit() {
        if (parseFloat(this.percent.getRawValue()) >= 0 && parseFloat(this.percent.getRawValue()) <= 100) {
            this.tempDetail.percent_discount = parseFloat(this.percent.getRawValue());
            this.disabled = true;
            this.isVisibleEditUnitPrice = false;
        }
        else {
            this.disabled = false;
        }
    }
    /**
     * đóng modal nhập giá giảm sp và ko lưu
     */
    handleCancelEditUnit() {
        this.isVisibleEditUnitPrice = false;
    }
    /**
     * mở modal chỉnh sửa số lượng sp trong km
     */
    openEditUnitQuantity(detail) {
        this.temp = detail;
        this.isVisibleEditUnitQuantity = true;
        this.vhAlgorithm.waitingStack().then(() => {
            this.quantity = this.vhAlgorithm.vhnumeral('.unit_quantity');
        });
    }
    /**
     * xử lý sk nhấn ok modal chỉnh sửa số lượng sp trong km
     */
    handleEditUnitQuantity() {
        if (this.quantity.getRawValue() >= 0) {
            this.temp.quantity = parseFloat(this.quantity.getRawValue());
        }
        else if (this.quantity.getRawValue() < 0)
            this.vhComponent.alertMessageDesktop('error', this.lang.translate('Invalid data, please check again'));
        this.isVisibleEditUnitQuantity = false;
    }
    /**
     * đóng modal chỉnh sửa số lượng sp trong km
     */
    handleCancelEditUnitQuantity() {
        this.isVisibleEditUnitQuantity = false;
    }
    /**
     * xóa sp KM
     */
    remove(item) {
        this.modal.confirm({
            nzTitle: `Xóa <strong><i>${item.name}</i></strong> ?`,
            // nzContent: '<b>Xóa sản</b>',
            nzOnOk: () => this.data.splice(this.data.indexOf(item), 1)
        });
    }
    /**
     * mở modal nhập giá giảm cho tất cả
     */
    openEditUnitPriceAll() {
        this.isVisibleEditUnitPriceAll = true;
        this.vhAlgorithm.waitingStack().then(() => {
            this.new_discount = this.vhAlgorithm.vhnumeral('.unit_price_all');
        });
    }
    /**
     * xử lý sk nhấn ok modal nhập giá giảm cho tất cả
     */
    handleEditUnitAll() {
        if (this.new_discount.getRawValue() >= 0 && this.new_discount.getRawValue() < 100) {
            for (let i = 0; i < this.data.length; i++) {
                this.data[i].percent_discount = parseFloat(document.getElementById('unit_price_all')['value']);
                //  this.data[i].discount = parseFloat(this.new_discount.getRawValue());
                this.discount_percent_all = parseFloat(this.new_discount.getRawValue());
                this.disabled_all = true;
            }
            this.isVisibleEditUnitPriceAll = false;
        }
        else {
            this.disabled_all = false;
        }
    }
    /**
     * đóng modal nhập giá giảm cho tất cả và ko lưu
     */
    handleCancelEditUnitAll() {
        this.isVisibleEditUnitPriceAll = false;
    }
}
